		public class VtoPdfSettings {

			public const string EOS_MODEL = "base64:";

			public Color FillColor { get; set; }
			public Color TextColor { get; set; }
			public Color BorderColor { get; set; }
			public string _ImageUrl { get; set; }
			public string ImageUrl {
				get { return _ImageUrl; }
				set {
					_ImageUrl = value;
					_Download = null;
				}
			}
			public ImageDownload _Download { get; set; }
			public Color LightTextColor { get; set; }
			public Color LightBorderColor { get; internal set; }
			public Color FillTextColor { get; set; }
            public int? MaxSeconds { get; internal set; }

            public async Task<ImageDownload> GetImage() {
				if (_Download == null) {
					_Download = await ImageDownload.GetImage(ImageUrl);
				}
				return _Download;
			}
			public VtoPdfSettings(OrganizationSettings settings) :this(){
				FillColor = settings.PrimaryColor.WithAlpha(100).ToMigradocColor();
				BorderColor = settings.PrimaryColor.ToMigradocColor();
				TextColor = settings.TextColor.ToMigradocColor();
				LightBorderColor = FillColor;
				if (settings.HasImage()) {
					ImageUrl = settings.GetImageUrl(ImageSize._img);
				}
			}

			[Obsolete("Use other constructor")]
			public VtoPdfSettings() {

				FillColor = new Color(100, 100, 100, 100);
				LightTextColor = new Color(100, 100, 100, 100);
				LightBorderColor = new Color(100, 100, 100, 100);
				FillTextColor = new Color(0, 0, 0);
				TextColor = new Color(0, 0, 0);
				BorderColor = new Color(0, 0, 0);

				//ImageUrl = "https://s3.amazonaws.com/Radial/base/Vto/EOS_Wheel.png";
				_Download = GenerateDefaultImage();
			}

			public static Color? Hex2Color(string hex) {
				try {
					if (hex == null)
						return null;
					System.Drawing.Color col = System.Drawing.ColorTranslator.FromHtml(hex);
					return Color.FromRgb(col.R, col.G, col.B);
				} catch (Exception e) {
					return null;
				}
			}

			public VtoPdfSettings(string imageUrl, string fillColor, string lightTextColor, string lightBorderColor, string fillTextColor, string textColor, string borderColor) : this() {
				if (imageUrl != null)
					ImageUrl = imageUrl;
				FillColor = Hex2Color(fillColor) ?? FillColor;
				LightTextColor = Hex2Color(lightTextColor) ?? LightTextColor;
				LightBorderColor = Hex2Color(lightBorderColor) ?? LightBorderColor;
				FillTextColor = Hex2Color(fillTextColor) ?? FillTextColor;
				TextColor = Hex2Color(textColor) ?? TextColor;
				BorderColor = Hex2Color(borderColor) ?? BorderColor;

			}

			public static ImageDownload GenerateDefaultImage() {
				return new ImageDownload() {
					Width = 1167,
					Height = 1070,
					Base64 = EOS_MODEL,
				};
			}

			public class ImageDownload {
				public string Base64 { get; set; }
				public int Width { get; set; }
				public int Height { get; set; }

				public async static Task<ImageDownload> GetImage(string url) {
					try {
						using (var client = new System.Net.WebClient()) {
							var bytes = client.DownloadData(url);
							var b64 = "base64:" + Convert.ToBase64String(bytes);
							using (var ms = new MemoryStream(bytes)) {
								var img = System.Drawing.Image.FromStream(ms);
								return new ImageDownload() {
									Base64 = b64,
									Width = img.Width,
									Height = img.Height
								};
							}
						}
					} catch (Exception e) {
						return GenerateDefaultImage();
					}
				}
			}
		}

		public class VtoVisionDocumentGenerator : IDocumentGenerator {

			public const string MARKETING_COLUMN = "MARKETING_COLUMN";
			public const string LEFT_COLUMN = "LEFT_COLUMN";
			public const string RIGHT_COLUMN = "RIGHT_COLUMN";

			public static Unit LEFT_TITLE_WIDTH = Unit.FromInch(1.66);
			public static Unit LEFT_CONTENT_WIDTH = Unit.FromInch(5.33);
			public static Unit RIGHT_WIDTH = Unit.FromInch(3.4);

			public static Unit PAGE1_HEIGHT = Unit.FromInch(5.5);
			public static Unit PAGE2_HEIGHT = Unit.FromInch(7.3);

			public static Unit CELL_PADDING = Unit.FromInch(.05);
			public static Unit HEADING_HEIGHT = Unit.FromInch(.55);

			/*
				var leftTitleWidth = Unit.FromInch(1.66);
				var leftContentWidth = Unit.FromInch(5.33);

				var leftWidth = leftTitleWidth + leftContentWidth;
				var rightWidth = Unit.FromInch(3.4); 
			 */

			public class VtoVisionPageGenerator : IPageGenerator {
				public int Page { get; set; }
				public AngularVTO vto { get; set; }
				public VtoPdfSettings Settings { get; private set; }

				public VtoVisionPageGenerator(int page, AngularVTO vto, VtoPdfSettings settings) {
					Page = page;
					this.vto = vto;
					Settings = settings;
				}

				protected Unit GetHeight() {
					if (Page == 0) {
						return PAGE1_HEIGHT;
					}
					return PAGE2_HEIGHT;
				}

				private void AddHeader(Cell cell, Unit width, string title, Action<Cell> populateContents) {

					var innerTable = new Table();
					innerTable.AddColumn(width);
					var row = innerTable.AddRow();

					row.Height = HEADING_HEIGHT;
					var typTitle = row.Cells[0];
					typTitle.Shading.Color = Settings.FillColor;
					typTitle.Format.Font.Color = Settings.FillTextColor;
					typTitle.AddParagraph(title);
					typTitle.Format.Font.Name = "Arial Narrow";
					typTitle.Format.Font.Bold = true;
					typTitle.Format.Font.Size = 14;
					typTitle.Format.Alignment = ParagraphAlignment.Center;
					row.VerticalAlignment = VerticalAlignment.Center;
					row.Borders.Bottom.Color = Settings.BorderColor;
					row = innerTable.AddRow();

					populateContents(row.Cells[0]);

					cell.Elements.Add(innerTable);

				}

				public async Task Draw(Section section, IEnumerable<string> requiredSections, IEnumerable<IDrawInstruction> instructions) {

					if (Page == 0) {
						await AddVtoPageToSection(section, vto.Name ?? "", "VISION", Settings);
					}

					//var TableGray = new Color(100, 100, 100, 100);
					//var TableBlack = new Color(0, 0, 0);
					var vision = section.AddTable();
					vision.Style = "Table";
					vision.Borders.Color = Settings.BorderColor;
					vision.Borders.Width = 1;
					vision.Rows.LeftIndent = 0;
					vision.LeftPadding = 0;
					vision.RightPadding = 0;

					var hasLeft = requiredSections.Contains(LEFT_COLUMN);
					var hasRight = requiredSections.Contains(RIGHT_COLUMN);

					if (hasLeft && hasRight) {
						vision.AddColumn(LEFT_TITLE_WIDTH + LEFT_CONTENT_WIDTH);
						vision.AddColumn(RIGHT_WIDTH);
						var row = vision.AddRow();
						//add core value, core focus, 10yr target, and strategy
						foreach (var c in instructions.Where(x => x.ViewBox.GetName() == LEFT_COLUMN)) {
							row.Cells[0].Elements.Add(c.Contents);
						}
						/*row = vision.AddRow();
						foreach (var c in instructions.Where(x => x.ViewBox.GetName() == MARKETING_COLUMN)) {
							row.Cells[0].Elements.Add(c.Contents);
						}*/
						//Add three year column
						var parentCell = row.Cells[1];
						var title = vto.ThreeYearPicture.ThreeYearPictureTitle ?? "3-YEAR-PICTURE™";
						AddHeader(parentCell, RIGHT_WIDTH, title, content => {
							foreach (var c in instructions.Where(x => x.ViewBox.GetName() == RIGHT_COLUMN)) {
								content.Elements.Add(c.Contents);
							}
						});
					} else if (hasLeft) {
						vision.AddColumn(LEFT_TITLE_WIDTH + LEFT_CONTENT_WIDTH + RIGHT_WIDTH);
						var row = vision.AddRow();
						//add core value, core focus, 10yr target, and strategy
						foreach (var c in instructions.Where(x => x.ViewBox.GetName() == LEFT_COLUMN)) {
							row.Cells[0].Elements.Add(c.Contents);
						}
						/*row = vision.AddRow();
						foreach (var c in instructions.Where(x => x.ViewBox.GetName() == MARKETING_COLUMN)) {
							row.Cells[0].Elements.Add(c.Contents);
						}*/


					} else if (hasRight) {
						var w = LEFT_TITLE_WIDTH + LEFT_CONTENT_WIDTH + RIGHT_WIDTH;
						vision.AddColumn(w);
						var row = vision.AddRow();
						var parentCell = row.Cells[0];
						var title = vto.ThreeYearPicture.ThreeYearPictureTitle ?? "3-YEAR-PICTURE™";
						AddHeader(parentCell, w, title, content => {
							//Add three year column
							foreach (var c in instructions.Where(x => x.ViewBox.GetName() == RIGHT_COLUMN)) {
								content.Elements.Add(c.Contents);
							}
						});
					}
				}

				public IEnumerable<INamedViewBox> GetViewBoxes(IEnumerable<string> requiredSections) {
					var hasLeft = requiredSections.Contains(LEFT_COLUMN);
					var hasRight = requiredSections.Contains(RIGHT_COLUMN);
					if (hasLeft && hasRight) {
						yield return new NamedViewBox(LEFT_COLUMN, LEFT_TITLE_WIDTH + LEFT_CONTENT_WIDTH, GetHeight());
						yield return new NamedViewBox(RIGHT_COLUMN, RIGHT_WIDTH - 2 * CELL_PADDING, GetHeight() - HEADING_HEIGHT);
						//yield return new NamedViewBox(MARKETING_COLUMN, LEFT_CONTENT_WIDTH, GetHeight());
						yield break;
					}

					var fullWidth = LEFT_TITLE_WIDTH + LEFT_CONTENT_WIDTH + RIGHT_WIDTH;

					if (hasLeft) {
						yield return new NamedViewBox(LEFT_COLUMN, fullWidth, GetHeight());
						//yield return new NamedViewBox(MARKETING_COLUMN, fullWidth - LEFT_TITLE_WIDTH, GetHeight());
						yield break;
					}
					if (hasRight) {
						yield return new NamedViewBox(RIGHT_COLUMN, fullWidth, GetHeight() - HEADING_HEIGHT);
						yield break;
					}
					yield break;
				}


			}

			public AngularVTO vto { get; set; }
			public VtoPdfSettings Settings { get; private set; }

			public VtoVisionDocumentGenerator(AngularVTO vto, VtoPdfSettings settings) {
				this.vto = vto;
				Settings = settings;
			}

			public IPageGenerator GetPageLayout(int page) {
				return new VtoVisionPageGenerator(page, vto, Settings);
			}
		}
	}

}